import "./App.css";

function App() {
  return (
    <div>
      <div>Username</div>
      <input name="userName" id="emailField" type="text" />
      <div>Password</div>
      <input name="password" id="pswField" type="text" />
      <button type="submit">Submit</button>
    </div>
  );
}

export default App;
